Você talvez não imagine toda a logística que envolve um casamento. 

Decidimos por aqui, que vamos compartilhar um pouco mais dos bastidores com vocês, e iniciaremos isso relembrando o casamento da 
@deborassr_ e do @dudumatta em Búzios. 

São centenas de profissionais envolvidos desde o início da montagem de um casamento, até conseguirmos captar as imagens incríveis que vocês acompanham por aqui, as cenas de alegria e comemorações dos casais, talvez façam passar batido, que nos bastidores estamos a 1.000 por hora para entregar o melhor trabalho possível, e sempre com sorriso no rosto. 

