@may.randrade e @leotranche Além de serem apaixonados um pelo outro, formam um casal extremante apaixonante, é aquele tipo de casal que a gente se sente privilegiado por conhecer e poder fazer parte do dia mais especial da vida deles, possuem uma energia única, especial, são generosos e amorosos, e isso era evidente em cada detalhe. 

O vídeo deles não poderia ser diferente, emocionante e cinematográfico, aqui prezamos pela atemporalidade em cada trabalho que entregamos, queremos que a May e o Léo vejam esse vídeo daqui 10, 15, 20 anos e ainda possam sentir a emoção que foi vivenciar esse momento de celebrar a união do casal e receber o amor e carinho das pessoas presentes. 

Para ser um vídeo atemporal, zelamos pela qualidade, mantemos as cores reais da decoração, sem uso de edição que altere a realidade, além de fazermos uma curadoria cuidadosa na escolha da trilha sonora, bem como de cada cena que irá compor o vídeo. Luz, ângulos, expressões, momentos espontâneos e importantes, tudo isso faz parte do nosso checklist de qualidade ao captarmos as cenas e montarmos o vídeo final com um proposta cinemática. 

Para esse resultado lindo, não poderíamos deixar de agradecer a colaboração e carinho dos nossos colegas de trabalho, e hoje especialmente queremos agradecer 3 especificamente: 

@carolpessanha.eventos por sua dedicação em fazer tudo fosse necessário para fazermos cenas lindas com o casal  e construir um cronograma que pensasse na importância do tempo para as fotos e vídeos. 

@saviocardosodesign simplesmente por ser o artista que é, impossível trabalhar com o Sávio e não ver beleza e poesia em cada detalhe, que honra a nossa ter você como amigo e colega de trabalho. 

@fotografofelipesales pela parceria durante todo o evento, especialmente nos momentos que exigia direção do casal, para as cenas, a harmonia entre foto e vídeo no dia do casamento faz toda diferença para o resultado final. 

Por último e não menos importante May e Leo, obrigado pela confiança, por esse dia lindo, e por nos escolher, desejamos que vocês sejam imensamente felizes e prósperos, pois vocês merecem tudo de melhor nessa vida ❤️
